import React, { useEffect } from "react";
import './Graph.css';
import '../../jquery-loader';
import ReactFlot from "react-flot";
import '../../../node_modules/react-flot/flot/jquery.flot.time.min';

function Graph(props) {

    console.log(props)

    const data = [
        {
            data: [[0, 50], [4, 28]],
            color: "red",
            series: {
                lines: { 
                    show: true, 
                    fill: true, 
                    fillColor: {
                        colors: [{ opacity: 1 }, { opacity: 1 } ]
                    }
                }
            }
        },
        {
            data: [[8, 65], [12, 70]],
            color: "yellow",
            series: {
                lines: { 
                    show: true, 
                    fill: true, 
                    fillColor: {
                        colors: [{ opacity: 1 }, { opacity: 1 } ]
                    } 
                }
            } 
        }
];

    let ticks = [[0,"00:00"]]

    for (let i = 2; i < 25; i = i + 2) {
        if (i < 10) {
            ticks.push([i, `0${i}:00`])
        } else {
            ticks.push([i, `${i}:00`]) 
        }
    }

    const options = {
        xaxis: {
            min: 0, 
            max: 24, 
            mode: "time", 
            timeformat: "%H:%M",
            ticks: ticks
        }, 
        yaxis: {
            min: 0, 
            max: 350,
            ticks: [100, 180]
        },
        series: {
            lines: { show: true },
            points: { show: true }
        }
    }

    return (
        <ReactFlot id="product-chart" data={data} options={options} width="100%" height="250px" />
      );

}

export default Graph;
